import { SIGN_IN, SIGN_UP } from "../constants/actionTypes.js";

const initializeUserData = {
    phoneNumber: "",
    country: "",
    userName: "",
    password: "",
    isLogin: false,
};


export default (state = initializeUserData, action) => {
    switch (action.type) {
        case SIGN_IN:
            return {...state.payload, isLogin: true};
        case SIGN_UP:
            return state;
        default:
            return state;
    }
};
